import React from 'react';

import '../App.css';

const Sample = ({ sample }) => {
  return (
    <div className="flex flex-row" key={sample.id}>
      <div className="flex-col-1">
        <a href={`/samples/${sample.id}`}>{sample.name}</a>
      </div>
      <div className="flex-col-2">
        {sample.description}
      </div>
    </div>
  );
}

export default Sample;
